    // stok kontrol işlemleri burada yapılır
    console.log('Stok kontrolü yapılıyor...');
    navigate('/CategoryList');
  }


  return (
    <>
      <div>
        {/* .. */}
      </div>
      <h1>Admin Paneli</h1>
      <button type onClick={handleStokKontrol} className='stokkontrol'>Stok Kontrol</button>
    </>
  );
}
